
-- BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "countries" ("id" integer PRIMARY KEY  NOT NULL, "name" varchar, "continent" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "dive_sites" ("id" integer PRIMARY KEY  NOT NULL, "name" varchar, "latitude" float, "longitude" float, "country_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_7a34cd35fe"
FOREIGN KEY ("country_id")
  REFERENCES "countries" ("id")
);
-- COMMIT;
